  false,\n\t\"url\": null,\n\t\"notes\": \"<p>Data reported in Evaluating Whether
  Higher Utilization of Hospital Outpatient Services Contributed to Lower Readmission
  Rate in 2012, published in Volume 4, Issue 1, of the Medicare and Medicaid Research
  Review, sheds light on the question of whether the Medicare all-condition readmission
  rate declined in 2012 because emergency department services or observation stays
  systematically replaced inpatient readmissions. In 2012, the prevalence of readmission
  stays fell by -3.7 per-1,000 Medicare beneficiaries, while the prevalence of ED
  visits remained almost unchanged and observation stays increased by just 0.3. The
  prevalence of readmissions fell by substantially more in 2012 than any of the previous
  five years, but the annual change in observation stays was largely consistent over
  the study period.</p>n\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
